import React from "react";

const MyPage = () => {
  return (
    <div className="mt-5">
      <h1 className="text-center mb-5">マイページ</h1>

      <div>
        <p>ログイン済の場合に表示されるアプリのホーム画面です。</p>
        <p>
          ログアウトしたい場合は、ヘッダーナビの「ログアウト」からログアウトしてください。
        </p>
      </div>
    </div>
  );
};

export default MyPage;
